import logo from "./logo.svg";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  BrowserRouter,
} from "react-router-dom";
import Wishlist from "./components/WishlistList/WishlistList";
import ItemList from "./components/WishlistList/ItemList";

const NoPage = () => {
  return <h1>404</h1>;
};
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<ItemList />}>
          <Route index element={<ItemList />} />
          <Route path="wishlist/:id" element={<ItemList />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
